import React from "react";
import pic1 from "../assets/images/abc.webp";
import pic2 from "../assets/images/abc.webp";

import pic3 from "../assets/images/bcd.webp";

function About() {
    return (
        <div className="About">
            <div className="pic1"><a href="https://reactjs.org/" target={"_blank"}><img src= {pic1} alt="image"/></a></div>
            <div className="pic2"><a href="https://reactjs.org/" target={"_blank"}><img src={pic2} alt="image"/></a></div>
        </div>
        )
}
export default About;
